import React from 'react';
import LessonCard from '../LessonCard';

const PhishingQuiz = () => {
  return (
    <LessonCard title="Phishing Quiz">
      <ol>
        <li>What is a common sign of a phishing email?</li>
        <li>What should you do if you receive a suspicious link?</li>
        <li>Why do attackers use urgency in phishing emails?</li>
      </ol>
    </LessonCard>
  );
};

export default PhishingQuiz;
